import './App.css';

function App() {

  let expenses = [
    {
      id: 1,
      title: "School Fee",
      Amount: 1000,
      date: new Date()
    },
    {
      id: 2,
      title: "Books",
      Amount: 200,
      date: new Date()
    },
    {
      id: 3,
      title: "Food",
      Amount: 100,
      date: new Date()
    },
    {
      id: 4,
      title: "Tuition",
      Amount: 1200,
      date: new Date()
    }
  ];

}

export default App;
